pub enum ConnectRequest {
    Client(RequestHeadType, Body, Option<net::SocketAddr>),
    Tunnel(RequestHead, Option<net::SocketAddr>),
}

pub enum ConnectResponse {
    Client(ClientResponse),
    Tunnel(ResponseHead, Framed<BoxedSocket, ClientCodec>),
}

pub enum ConnectRequestFuture<Fut, Io> where Io: ConnectionIo {
    Connection {
        fut: Fut,
        req: Option<ConnectRequest>,
    },
    Client {
        fut: LocalBoxFuture,
    },
    Tunnel {
        fut: LocalBoxFuture,
    },
}

pub enum JsonPayloadError {
    ContentType,
    Deserialize(JsonError),
    Payload(PayloadError),
}

pub enum RedirectServiceFuture<S> where S: Service<ConnectRequest, Response =
         ConnectResponse, Error = ConnectResponse>, S: 'static {
    Tunnel {
        fut: S::Future,
    },
    Client {
        fut: S::Future,
        max_redirect_times: u8,
        uri: Option<Uri>,
        method: Option<Method>,
        body: Option<Bytes>,
        addr: Option<SocketAddr>,
        connector: Option<Rc<S>>,
    },
}

pub enum SendClientRequest {
    Fut(Pin<Box<dyn Future<Output =
                Result<ConnectResponse, SendRequestError>>>>,
        Option<Pin<Box<Sleep>>>, bool),
    Err(Option<SendRequestError>),
}
